import React, { Component } from "react";
import NoteListComponent from '../components/note/NoteListComponent'
import FolderListComponent from '../components/folder/FolderListComponent'

class Home extends Component {


    render() {
        return (
            <div className="App">
                <div className="row">
                    <div className="col-4">
                        <FolderListComponent/>
                    </div>
                    <div className="col-6">
                        <NoteListComponent/>
                    </div>
                </div>
            </div>
        )
    }

}


export default Home;
